import React, { useState } from 'react';
import '../cssfiles/Registration.css';
import axios from 'axios';
import Register from '../../../../../demo_register/frontend_login/src/Register';

export default function Registration() {
  const [formData, setFormData] = useState({
    mobileNumber: '',
    email: '',
    fname: '',
    lname: '',
    fathername: '',
    address: '',
    pincode: '',
    dob: '',
    password: ''
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value
    });
  };

  const handleSubmit = async(e) => {
    e.preventDefault();
    try{
        const response = await axios.post("http://localhost:8080/register",formData)
        console.log(response);
        

    }catch(error){
        console.log(error);
    }
  };

  return (
    <div className="registration-container">
      <h2 className="text-center mb-4">Create New Account</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-row">
          <div className="form-group col-md-6">
            <label>Mobile Number</label>
            <input type="text" className="form-control" name="mobileNumber" value={formData.mobileNumber} onChange={handleChange} required />
          </div>
          <div className="form-group col-md-6">
            <label>Email</label>
            <input type="email" className="form-control" name="email" value={formData.email} onChange={handleChange} required />
          </div>
        </div>

        <div className="form-row">
          <div className="form-group col-md-6">
            <label>First Name</label>
            <input type="text" className="form-control" name="fname" value={formData.fname} onChange={handleChange} required />
          </div>
          <div className="form-group col-md-6">
            <label>Last Name</label>
            <input type="text" className="form-control" name="lname" value={formData.lname} onChange={handleChange} required />
          </div>
        </div>

        <div className="form-group">
          <label>Father's Name</label>
          <input type="text" className="form-control" name="fathername" value={formData.fathername} onChange={handleChange} required />
        </div>

        <div className="form-group">
          <label>Address</label>
          <input type="text" className="form-control" name="address" value={formData.address} onChange={handleChange} required />
        </div>

        <div className="form-row">
          <div className="form-group col-md-6">
            <label>Pincode</label>
            <input type="text" className="form-control" name="pincode" value={formData.pincode} onChange={handleChange} required />
          </div>
          <div className="form-group col-md-6">
            <label>Date of Birth</label>
            <input type="date" className="form-control" name="dob" value={formData.dob} onChange={handleChange} required />
          </div>
        </div>

        <div className="form-group">
          <label>Password</label>
          <input type="password" className="form-control" name="password" value={formData.password} onChange={handleChange} required />
        </div>

        <button type="submit" className="btn btn-success btn-block mt-3">Register</button>
      </form>
    </div>
  );
}
